import React from 'react';
import ReactDOM from 'react-dom/client';

export default function Main() {

    return (

        <div>
            <h1 className='main-about'>About</h1>

            <p> As a frontend developer, my passion lies in crafting streamlined experiences and automating everyday processes. 
                Simplifying complexities and enhancing efficiency are my driving forces.
                I prioritize staying abreast of cutting-edge security measures and industry best practices,
                constantly seeking fresh knowledge to expand my skill set. </p>

                <h1 className='main-interests'> Interests </h1>

                <p>Anime. Gaming. Reader. Internet fanatic. Movies. Entrepreneur. Travel geek. Pop culture ninja. Coffee fanatic.</p>




        </div>


    )
}
